(1658, 319, 'news_detail', 'England captain Eoin Morgan won the toss and elected to field in the third and deciding one-day international against India at Headingley on Tuesday. England made one change to the side that won the second ODI by 86 runs on Saturday, with Hampshire batsman James Vince replacing Jason Roy after the opener suffered a finger injury while fielding at Lord\'s. India made three changes with paceman Bhuvneshwar Kumar fit following a back injury. Bhuvneshwar and Shardul Thakur replaced fellow seamers Umesh Yadav and Siddarth Kaul, with batsman Dinesh Karthik coming in for KL Rahul. India were bidding for their 10th successive bilateral ODI series win, with 2019 World Cup hosts England looking to treat Tuesday\'s match as the kind of winner-takes-all knockout match they will hope to play during next year\'s global showpiece event.'),
